import React from 'react';

export default function Home() {
  return (
    <div className="page">
      <h1>Welcome to YogaPlanet</h1>
      <p>Your journey to health begins here. Explore poses, pranayama, meditation and join live classes.</p>
      <section>
        <h2>Featured Poses</h2>
        <p>(Automatically fetched from the API when connected)</p>
      </section>
      <section>
        <h2>Upcoming Schedule</h2>
        <p>Check the Schedule page for daily classes.</p>
      </section>
    </div>
  );
}
